-- DROP TABLE statements
DROP TABLE IF EXISTS Payments;
DROP TABLE IF EXISTS Maintenance;
DROP TABLE IF EXISTS Rents;
DROP TABLE IF EXISTS Vehicles;
DROP TABLE IF EXISTS Pricing;
DROP TABLE IF EXISTS Locations;
DROP TABLE IF EXISTS Customers;

-- CREATE TABLE statements

CREATE TABLE Customers (
    customer_id INT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    email VARCHAR(100) NOT NULL UNIQUE,
    phone_number VARCHAR(15) NOT NULL
);

CREATE TABLE Pricing (
    size VARCHAR(20) PRIMARY KEY CHECK (size IN ('Compact', 'Midsize', 'Fullsize', 'SUV', 'Truck', 'Luxury')),
    daily_rate DECIMAL(10, 2) NOT NULL,
    weekly_rate DECIMAL(10, 2) NOT NULL
);

CREATE TABLE Vehicles (
    vehicle_id INT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    make VARCHAR(50) NOT NULL,
    model VARCHAR(50) NOT NULL,
    year INT NOT NULL,
    license_plate VARCHAR(20) NOT NULL UNIQUE,
    size VARCHAR(20) NOT NULL REFERENCES Pricing(size)
);

CREATE TABLE Locations (
    location_id INT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    location_name VARCHAR(100) NOT NULL,
    address VARCHAR(255) NOT NULL,
    phone_number VARCHAR(15) NOT NULL
);

CREATE TABLE Maintenance (
    maintenance_id INT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    vehicle_id INT NOT NULL REFERENCES Vehicles(vehicle_id),
    maintenance_date DATE NOT NULL,
    details TEXT,
    status VARCHAR(20) CHECK (status IN ('Scheduled', 'Completed')) DEFAULT 'Scheduled'
);

CREATE TABLE Rents (
    customer_id INT NOT NULL REFERENCES Customers(customer_id),
    vehicle_id INT NOT NULL REFERENCES Vehicles(vehicle_id),
    rental_start_date DATE NOT NULL,
    rental_end_date DATE NOT NULL,
    pickup INT NOT NULL REFERENCES Locations(location_id),
    dropoff INT NOT NULL REFERENCES Locations(location_id),
    PRIMARY KEY (customer_id, vehicle_id, rental_start_date)
);

CREATE TABLE Payments (
    payment_id INT GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    customer_id INT NOT NULL,
    vehicle_id INT NOT NULL,
    rental_start_date DATE NOT NULL,
    amount DECIMAL(10, 2) NOT NULL,
    payment_date DATE,
    payment_method VARCHAR(20) CHECK (payment_method IN ('Credit Card', 'Debit Card', 'Cash', 'Bank Transfer')),
    FOREIGN KEY (customer_id, vehicle_id, rental_start_date) REFERENCES Rents(customer_id, vehicle_id, rental_start_date)
);

